komedie/102 min

regie:Raja Gosnell
met Alex D.Linz,Olek Krupa en Rya Kihlstedt


Het lot van de hele wereld hangt aan een zijden draadje, wanneer zware criminelen hun ware tegenstander ontmoeten: en hij is pas acht jaar oud! Een internationale bende heeft een uiterst geheime computer chip gestolen en verborgen in een speelgoed auto. Door een vergissing op het vliegveld belandt het autootje in handen van Alex Pruitt (Alex D. Linz - One Fine Day), die alleen thuis zit vanwege waterpokken. Wanneer de bendeleden het huis van Alex proberen binnen te dringen met high-tech snufjes, stuiten ze op heftig verzet van onze slimme held, die tal van valstrikken en booby traps heeft verzonnen om de bende op te rollen. Komedie-legende John Hughes (Home Alone 1&amp;2) is weer terug met deze hilarische film vol actie en spanning voor de hele familie.


